import React from 'react';
import {connect} from 'react-redux'


import CollectionItem from '../collection-item/collection-item.component';

import './collections.scss'
import { selectItemCollection } from '../../redux/shop/shop.reselector';

const Collections = ({ match ,title, items }) => {
    console.log(match);
    return (
        <div className='collections'>
          <h1 className='title'>{title.toUpperCase()}</h1>
          <div className='preview'>
            {items.map(({ id, ...otherItemProps }) => (
                <CollectionItem key={id} {...otherItemProps} />
              ))}
          </div>
        </div>
      );
}
const  mapStateToProps = (state,prpps)=>({
itemCollection: selectItemCollection(props.match.collectionId)(state)
})
export default  connect(mapStateToProps,null)( Collections);
